import React, { useState } from 'react';
import './Form.css';

function Form({ onSubmit, loading, error }) {
  const [formData, setFormData] = useState({
    url: '',
    sector: '',
    offer: '',
    email: '',
    analysis_type: 'both'
  });

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    onSubmit(formData);
  };

  return (
    <div className="form-container">
      <div className="form-card">
        <h2 className="form-title">Lancer une analyse</h2>
        <p className="form-description">
          Remplissez le formulaire ci-dessous pour √©valuer le potentiel de visibilit√© de votre site.
        </p>

        {error && (
          <div className="error-message">
            {error}
          </div>
        )}

        <form onSubmit={handleSubmit} className="form">
          <div className="form-group">
            <label htmlFor="analysis_type" className="form-label">
              Type d'analyse *
            </label>
            <select
              id="analysis_type"
              name="analysis_type"
              value={formData.analysis_type}
              onChange={handleChange}
              className="form-select"
              required
            >
              <option value="both">üîç Analyse compl√®te (SEO + IA)</option>
              <option value="seo">üìà Analyse SEO uniquement</option>
              <option value="ia">ü§ñ Analyse IA uniquement</option>
            </select>
            <small className="form-hint">
              {formData.analysis_type === 'both' && 'Recommand√© : √©value les deux canaux de visibilit√©'}
              {formData.analysis_type === 'seo' && '√âvalue uniquement la pr√©paration pour les moteurs de recherche classiques'}
              {formData.analysis_type === 'ia' && '√âvalue uniquement la pr√©paration pour les moteurs conversationnels'}
            </small>
          </div>

          <div className="form-group">
            <label htmlFor="url" className="form-label">
              URL du site *
            </label>
            <input
              type="url"
              id="url"
              name="url"
              value={formData.url}
              onChange={handleChange}
              className="form-input"
              placeholder="https://example.com"
              required
            />
          </div>

          <div className="form-group">
            <label htmlFor="sector" className="form-label">
              Secteur d'activit√©
            </label>
            <input
              type="text"
              id="sector"
              name="sector"
              value={formData.sector}
              onChange={handleChange}
              className="form-input"
              placeholder="Ex: SaaS B2B, E-commerce, etc."
            />
          </div>

          <div className="form-group">
            <label htmlFor="offer" className="form-label">
              Offre principale
            </label>
            <input
              type="text"
              id="offer"
              name="offer"
              value={formData.offer}
              onChange={handleChange}
              className="form-input"
              placeholder="Ex: Logiciel de facturation"
            />
          </div>

          <div className="form-group">
            <label htmlFor="email" className="form-label">
              Email *
            </label>
            <input
              type="email"
              id="email"
              name="email"
              value={formData.email}
              onChange={handleChange}
              className="form-input"
              placeholder="votre@email.com"
              required
            />
            <small className="form-hint">
              Votre email sera utilis√© uniquement pour l'analyse et transmis √† l'administrateur.
            </small>
          </div>

          <button
            type="submit"
            className="form-button"
            disabled={loading}
          >
            {loading ? 'Analyse en cours...' : 'Lancer l\'analyse'}
          </button>
        </form>
      </div>
    </div>
  );
}

export default Form;
